import React from "react";

const Navbar = () => {

    return (
        <nav className="navbar navbar-expand-md navbar-dark bg-secondary px-2">
        <a className="navbar-brand" href="https://redux.js.org" target="_blank" rel="noreferrer">Redux</a>

        <button className="navbar-toggler" data-bs-toggle="collapse" data-bs-target="#hidden-menu">
              <span className="navbar-toggler-icon"></span>
        </button>

        <div className="offcanvas offcanvas-start" id="hidden-menu">
            <a className="btn-close d-md-none ms-auto me-2 mt-2 fs-5" href="" data-bs-dismiss="offcanvas"></a>
            <div className="offcanvas-body flex-md-row align-items-center ms-3 bg-secondary">
                <ul className="navbar-nav">
                    <li><a className="nav-link" href="">Shop</a></li>
                    <li><a className="nav-link" href="">Users</a></li>
                </ul>
            </div>
       </div>
</nav>
    );
}

export default Navbar;
